Rules.InvariantScript:
With(
    {
        varSenhaInformada: Value(Concatenate(ScreenSenha_digito1.Text,ScreenSenha_digito2.Text,ScreenSenha_digito3.Text,ScreenSenha_digito4.Text)),
        varSaldo: First(Sort(colHistorico,ThisRecord.ID,SortOrder.Descending)).Saldo
    },
    If(varSenhaInformada = _varSenha,
        Patch(colHistorico,
            Defaults(colHistorico),
            {
                ID: First(Sort(colHistorico,ThisRecord.ID,SortOrder.Descending)).ID + 1,
                Registro: _varTipo,
                Valor: varValor,
                Saldo: Switch(_varTipo,
                        "Transferência", varSaldo - varValor,
                        "Recebimento", varSaldo + varValor
                        ),
                Data: Today(),
                Para: Switch(_varTipo,
                        "Transferência", varItem.Nome,
                        "Recebimento", "Você mesmo"
                        )
            }
        );
        Navigate(ScreenSucesso,ScreenTransition.Cover, 
            {
                varItem: varItem,
                varValor: varValor,
                _varTipo:_varTipo
            }
        ),

        Notify("Senha inválida",NotificationType.Error);
        Concurrent(
            UpdateContext({varSenhaInvalida: true}),
            Reset(ScreenSenha_digito1),
            Reset(ScreenSenha_digito2),
            Reset(ScreenSenha_digito3),
            Reset(ScreenSenha_digito4),
            SetFocus(ScreenSenha_digito1)
        )
    )
)
